import React from "react";

const images = {
    1: "/images/apple.jpg",
    2: "/images/avocado.jpg",
    3: "/images/orange.jpg"
}

export default function Card(props) {

  return props.info.map(item => (
    <ul>
        <div id={item.id}>
            <img src={images[item.id]} alt={item.title} height="100"/>
            <div>{item.title}</div>
            <div><strong>Average Cost ${item.price}</strong> / LB</div>
            <div>Kingdom: {item.stats.kingdom}</div>
            <div>Family: {item.stats.family}</div>
            <div>Genus: {item.stats.genus}</div>
            <div>Origin: {item.location}</div>
        </div>
    </ul>
  ));

}
